import followers from './screens/Followers'
import {createAppContainer, Navigation} from 'react-navigation';
import {createStackNavigator} from 'react-navigation-stack';
import search from './screens/Search';
import home from './screens/Home';

export const restaurants = {
  "McDonald's" : {
    "id" : 0,
    "PricePoint" : "€",
    "Tags" : ["Hambúrgueres","Gelado e iogurte gelado", "Sobremesas","Adequado para crianças","Americana" ,"Fast food"],
    "Pratos" : {
      "McMenu BigMac LARGE" : { "Preço" : 2, "Opçoes" : ["Extra queijo", "Extra DIP"] }
    }
  },
  "Telepizza" : {
    "id" : 1,
    "Address" : "R. De José Rabumba, 3810-164 Aveiro, Portugal, 7, Aveiro 3810-164",
    "PricePoint" : "€",
    "Tags" : ["Pizza", "Fast Food"],
    "Pratos" : {
      "Pizza Havaiana" : { "Preço" : 20, "Opçoes" : ["Extra queijo"] }
    }
  },
}

const AppNavigator = createStackNavigator(
  {
    Home: { screen : home,
          },
    followers: {
              screen: followers,
              navigationOptions: () => ({
                title: `Github Social Club`,
                headerBackTitle: 'Go Back',
                headerStyle : {backgroundColor : 'black'},
                headerTitleStyle: {color: 'white'},
                headerTruncatedBackTitle: `Back`
              }),
    }
  },
  {
    initialRoute: 'Home',
  })

  const App = createAppContainer(AppNavigator);

  export default App;
